import React from 'react';
import ReactModal from 'react-modal';
import { useState, useEffect } from 'react';

const Footer = () => {

    const [isModalOpen, setIsModalOpen] = useState(false);
    const [date, setDate] = useState();
    const [creneau, setCreneau] = useState();
    const [heure, setHeure] = useState();

    const heureMatin = ["08h45 - 09h00", "09h00 - 09h15", "09h15 - 09h30", "09h30 - 09h45",
        "09h45 - 10h00", "10h00 - 10h15", "10h15 - 10h30", "10h30 - 10h45", "10h45 - 11h00",
        "11h00 - 11h15", "11h15 - 11h30", "11h30 - 11h45", "11h45 - 12h00"];

    const openModal = () => {
        setIsModalOpen(true);
    };

    const closeModal = () => {
        setIsModalOpen(false);
    };

    useEffect(() => {
        ReactModal.setAppElement('body');
    }, []);

    const dateRendezVous = new Date(date).getDay();
    console.log(dateRendezVous);

    if (dateRendezVous === 0) {
        console.log('Vous avec choisit une mauvaise date')
    }

    console.log('creneau', creneau)

    console.log('heure choisi', heure)

    return (
        <div className="Footer">
            <div className="horaireGarage">
                <table>
                    <div>
                        <tr>
                            <td>Lun :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                        <tr>
                            <td>Mar :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                    </div>
                    <div>
                        <tr>
                            <td>Mer :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                        <tr>
                            <td>Jeu :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                    </div>
                    <div>
                        <tr>
                            <td>Ven :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                        <tr>
                            <td>Sam :</td>
                            <td>08h45 - 12h00</td>
                        </tr>
                    </div>
                    <div>
                        <tr>
                            <td>Dim :</td>
                            <td>Fermé</td>
                        </tr>
                    </div>
                    <div>
                        <button onClick={openModal}>Je prends rendez-vous</button>
                    </div>
                </table>
            </div>
            <ReactModal
                isOpen={isModalOpen}
                onRequestClose={closeModal}
            >
                <form>
                    <legend>
                        Votre rendez-vous
                    </legend>
                    <h1>SELECTED DATE : {date}</h1>
                    <input type="text" name="nom" id="nom" placeholder="Votre nom"></input>
                    <label htmlFor="nom"></label>

                    <input type="text" name="prenom" id="prenom" placeholder="Votre prénom"></input>
                    <label htmlFor="prenom"></label>

                    <input type="email" name="email" id="email" placeholder="Votre email"></input>
                    <label htmlFor="email"></label>

                    <input type="tel" name="phone" id="phone" placeholder="Votre numéro de téléphone"></input>
                    <label htmlFor="phone"></label>

                    <input type="date" id="date" name="date" min="2024-01-01" max="2024-12-31" onChange={e => setDate(e.target.value)}></input>
                    <label htmlFor="date"></label>

                    {dateRendezVous === 6 ? null :
                        <label htmlFor="creneau" id="creneau">Choisissez votre créneau horaire souhaité
                            <input type="radio" id="creneau" name="creneau" onChange={(e) => setCreneau("Matin")}></input><span>Matin</span>
                            <input type="radio" id="creneau" name="creneau" onChange={(e) => setCreneau("Après-midi")}></input><span>Après-midi</span>
                        </label>
                    }

                    {creneau === "Matin" || dateRendezVous === 6 ?
                        <select
                            name="heureRendezVous"
                            id="heureRendezVous"
                            //required
                            value={heure}
                            onChange={(e) => setHeure(e.target.value)}
                        >
                            <option value="">Veuillez choisir votre heure de rendez-vous</option>
                            {heureMatin.map((horaire, index) => (
                                <option key={index} value={horaire}>
                                    {horaire}
                                </option>
                            ))}
                        </select>
                        :
                        creneau === "Après-midi" ?
                            <select
                                name="heureRendezVous"
                                id="heureRendezVous"
                                //required
                                value={heure}
                                onChange={(e) => setHeure(e.target.value)}
                            >
                                <option value="">Veuillez choisir votre heure de rendez-vous</option>
                                <option value="1">14h00 - 14h15</option>
                                <option value="2">14h15 - 14h30</option>
                                <option value="3">14h30 - 14h45</option>
                                <option value="4">14h45 - 15h00</option>
                                <option value="5">15h00 - 15h15</option>
                                <option value="6">15h15 - 15h30</option>
                                <option value="7">15h30 - 15h45</option>
                                <option value="8">15h45 - 16h00</option>
                                <option value="9">16h00 - 16h15</option>
                                <option value="10">16h15 - 16h30</option>
                                <option value="11">16h30 - 16h45</option>
                                <option value="12">16h45 - 17h00</option>
                                <option value="13">17h00 - 17h15</option>
                                <option value="14">17h15 - 17h30</option>
                                <option value="15">17h30 - 17h45</option>
                                <option value="16">17h45 - 18h00</option>
                            </select>
                            :
                            null
                    }
                </form>

            </ReactModal>
        </div>
    );
};

export default Footer;
